require.config({"config": {
        "text":{"PayPal_Braintree/template/payment/venmo.html":"<!-- Venmo -->\n<!-- ko if: isAllowed() -->\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}\" id=\"payment-method-braintree-venmo\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\" />\n        <label class=\"label\" data-bind=\"attr: {'for': getCode()}\">\n            <img data-bind=\"attr: {src: getPaymentMarkSrc(), alt: $t('Venmo')}\"\n                 width=\"60\"\n                 class=\"payment-icon\"/>\n            <span text=\"getTitle()\"></span>\n        </label>\n    </div>\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n\n        <div class=\"payment-method-billing-address\">\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"actions-toolbar\">\n            <div class=\"primary\">\n                <button class=\"action primary checkout\" data-bind=\"click: clickVenmoBtn\" type=\"submit\">\n                    <span data-bind=\"i18n: 'Pay with Venmo'\"></span>\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n<!-- /ko -->\n"}
}});
